import * as React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import Grid from '@mui/material/Grid';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import building from '../../Asserts/Logos/building.png'



function Header(props) {
  const { onDrawerToggle } = props;
  const buildindlist=['Blocks','Magnetic tiles','Marble runs','Construction sets'];

  return (
    <React.Fragment>
      <AppBar  sx={{ backgroundColor:'#f3ecb059',
    boxShadow:'0 8px 32px rgba(31,28,135,0.37) ',
    backdropFilter:' blur(8.5px)',
    borderRadius:'10px'}} position="relative" elevation={4}>
        <Toolbar>
          <Grid container spacing={2} >


            <Grid sx={{ display: { sm: 'none', xs: 'block' } }} item>
              <IconButton
                color="inherit"
                aria-label="open drawer"
                onClick={onDrawerToggle}
                edge="start"
              >
                <MenuIcon />
              </IconButton>
            </Grid>

            <Grid>


            <Grid container   direction="row"
                  justifyContent="center"
                  alignItems="center" sx={{backgroundColor:'red',}}>
              <img src={building} alt="building" style={{height:"60px",width:"100px",cursor:"pointer"}}></img>
              
            </Grid>


        </Grid>

          </Grid>
        </Toolbar>
      </AppBar>
      <div className="bg-white p-2  w-50 shadow-lg absolute -left-14 top-24" style={{color:'black'}}>
              <ul>
               {
               buildindlist.map((menu)=>(
                <li key={menu}>{menu}</li>

               ))
               }
              </ul>

            </div>
    </React.Fragment>
  );
}

Header.propTypes = {
  onDrawerToggle: PropTypes.func.isRequired,
};

export default Header;
